INSERT INTO `diary` VALUES (66, 'wnJava全新改版，各种求关注啊~', '<div style=\"text-align: left;\"><b style=\"font-family: \'Micro YAHEI\'; font-size: medium; \">&nbsp; &nbsp; &nbsp; &nbsp; 经过比较长时间的积淀，今天我完成了对wnJava主体网站的全面改版。撒花~~</b><br></div><div style=\"text-align: center;\"><br></div><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \">本次改版主要开放和优化了以下功能：</span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \"><br></span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \">1.开放注册。不再需要邀请码了~~</span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \"><br></span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \">2.全站显示效果和样式调整。相信这个大家一进入本站就感觉到了。</span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \"><br></span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \">3.注册用户即可发布日志，开放了编辑和删除日志功能。</span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \"><br></span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \">4.注册用户即可对系统进行留言。有什么想和我说的，提交bug什么的欢迎留言。</span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \"><br></span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \">5.优化了对日志的回复效果。</span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \"><br></span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \">6.日志可以插入图片了现在~</span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \"><br></span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \">7.开放了ChatBear平台。目前仅提供简单的消息推送功能，详见ChatBear模块介绍。</span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><span style=\"text-align: center; \"><br></span></blockquote><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\">后续还会持续更新，哈哈~~</blockquote></blockquote><div><br></div>', 1, '/img/head/default/anime/5.jpg', '偷懒的熊', '2013-7-26 22:12:49', '公告_开发日志', 120, 6, 'normal');
INSERT INTO `diary` VALUES (67, 'sdfasdf', 'asdfasdfasdf', 10, '/img/head/default/default.jpg', 'ahern88', '2013-8-1 22:15:07', '', 43, 0, 'normal');
INSERT INTO `diary` VALUES (68, '关于界面设计的说明', '昨天在开源中国发布了一个帖子，大概介绍了以下这个网站。<div><br></div><div>然后网上大牛果然犀利，一眼就发现了我这个网站在设计上的异常。</div><div><br></div><div>其实是最近才决定使用bootstrap框架的，这个之前一直都是原创，可惜效果很差。</div><div><br></div><div>我本就不是前台设计人员，专精的js和后台。设计什么的使用了bootstrap后缓解了我很多压力（绝对没有收广告费....）</div><div><br></div><div>现在这个版本参照了许多网站的设计风格，按照我的记忆来说，大概还记得下面的网站：</div><div><br></div><div>1.<span style=\"color: rgb(0, 0, 170); font-family: 微软雅黑, Verdana, sans-serif, 宋体; line-height: 22px; background-color: rgb(246, 246, 246); \">&nbsp;&nbsp;</span><a href=\"http://www.dandyweng.com/\" rel=\"nofollow\" style=\"padding: 0px; margin: 0px; color: rgb(62, 98, 166); outline: 0px; font-family: 微软雅黑, Verdana, sans-serif, 宋体; line-height: 22px; background-color: rgb(246, 246, 246); \">http://www.dandyweng.com/</a><span style=\"color: rgb(0, 0, 170); font-family: 微软雅黑, Verdana, sans-serif, 宋体; line-height: 22px; background-color: rgb(246, 246, 246); \">&nbsp;&nbsp;</span></div><div>&nbsp; &nbsp; 这是个专精设计的哥们写的，感觉很不错，拿来用了一部分，后续更新把你放到咱的友情链接里？？哈哈 你肯定不知道咱。</div><div><br></div><div>2.好像是jquery的官网，在第一版的时候参照过。</div><div><br></div><div>3.日志列表和日志页的设计初稿，参照的外国某网站，现在忘记了。</div><div><br></div><div>4.图册标题，初稿还想是参照的网易图册的样式？ 忘记了。</div><div><br></div><div>5.chatBear平台好像直接就是bootstrap的示例页面吧，当时刚学bootstrap，拿来用了。</div><div><br></div><div>总之我经常逛各种网站，能比较好的嵌入进来的我就直接用了，归根到底还是自己设计才能欠缺，美工技术不够啊，想到的创意，自己实现不了.....<br></div><div><br></div><div>以后或许会改进吧，不过现阶段就这样了。</div><div><br></div><div>直接拿来用感觉挺愧疚的，说到底就是几个css效果，等我什么时候把功能做的差不多了，再调整这些吧。</div><div><br></div><div>感谢所有提意见的兄弟们，你们都是我的亲兄弟啊~~~</div><div><br></div><div>放张图？~~~~这个是第一版v2时候的首页设计，后来进行了改版，是不是丑爆了....</div><div><br></div><div><img src=\"data:image/jpeg;base64,\"><br></div><div><br></div><div><br></div><div><br></div>', 1, '/img/head/default/anime/5.jpg', '偷懒的熊', '2013-8-2 10:27:19', '公告_说明', 142, 2, 'normal');
INSERT INTO `diary` VALUES (69, 'test', 'test&nbsp;<img src=\"data:image/jpeg;base64,\">', 18, '/img/head/default/default.jpg', 'gg1988727', '2013-8-5 21:47:28', '', 89, 2, 'normal');
INSERT INTO `diary` VALUES (70, '新增音乐播放器', '最新添加了音乐播放器~~<div><br></div><div>但是很不幸，由于html5的兼容性以及服务器的文件策略问题，亲测许多浏览器无法正常播放。</div><div><br></div><div>目前测试 webKit 火狐 Chrom 内核的浏览器和IE10内核的浏览器可以正常播放。IE10以下低版本均不可以（发布之前在本地是可以播放的，怀疑是服务器的问题）</div><div><br></div><div>总之这一版先这样，修正了其余的一些小bug,主要是上线这个播放器，对这个播放器（wnPlayer??）有什么意见的，欢迎留言啊</div><div><br></div><div><br></div><div><br></div>', 1, '/img/head/default/anime/5.jpg', '偷懒的熊', '2013-8-5 23:34:34', '公告_开发日志', 153, 4, 'top');
INSERT INTO `diary` VALUES (71, '搜狐面试记录', '今天去面试了 搜狐-焦点 的开发工程师职位，前后大概用时2个多小时。<div><br></div><div>面试题相对基础，但是考究的多是 数据结构 以及线程安全 的知识，有少量的设计模式以及servlet知识。</div><div><br></div><div>数据结构和线程的题答得一塌糊涂，这些东西本来自己就是明白个大概，真正落实到纸上就显得苍白了许多。</div><div><br></div><div>还好第一个面试官提问的方向比较偏重实践，在一面的时候我自觉表现的不错，多数问题都回答的不错。</div><div><br></div><div>中间休息，然后二面的面试官来了，是个体形壮硕的人，这是我的第一印象。</div><div><br></div><div>应该是技术经理之类的吧？</div><div><br></div><div>然后我就悲剧了，这位面试官从头到尾仿佛针对我的薄弱环节似地各种发问数据结构线程设计模式的基础问题，说到底可能不难，但是我压根儿没什么准备，唉 惨不忍睹。</div><div><br></div><div>不知道结果会如何，不过至少这次面试让我认清楚了自己的薄弱环节，也算没白白过了一个上午。</div><div><br></div><div>ps:</div><div>搜狐的工作环境还不错，要是能去就好了</div>', 1, '/img/head/default/anime/5.jpg', '偷懒的熊', '2013-8-6 14:44:25', '面试_', 183, 2, 'normal');
INSERT INTO `diary` VALUES (72, 'wnJava即将重构的计划说明', '自从网站8月份的pv一下子从100左右飙到400+，我一直在考虑一个事情。<div><br></div><div>我这个网站究竟是想要做什么呢？</div><div><br></div><div>不管是发布日志还是推送消息，甚至图册的部分，功能都没有十分的完善，杂而不精，大概就是现在的写照，而我时间有限，还要费心思思考网站的设计，力不从心啊。</div><div><br></div><div>所以接下来我会对现在的网站进行重构，不管是前台还是后台，都要马上开始重构！！</div><div><br></div><div>这个日志不过是记录我现在的心情罢了。</div><div><br></div><div>之所以重构有以下的原因：</div><div><br></div><div>1.网站的架构是jsp-servlet的，重构后我也不打算改变这个基础，只是随着功能的逐步开发，发现部分类的功能组织有些混乱，职责规划不清楚，需要进一步的解耦。</div><div><br></div><div>2.新的网站准备完全采用ajax的方式进行模块之间的跳转，尽量不再整个刷新页面，这么做是为了让音乐播放器得以持续的播放音乐。而这就需要彻底重写servlet的相关方法。</div><div><br></div><div>3.没有使用任何的jsp额外标签库，甚至广泛使用的c标签也没有使用。造成了现在页面比较的乱，重构需要编写自定义的标签，这也是练习的重点。</div><div><br></div><div>4.重构后的网站不再提供图册的功能，是为了简化和突出网站的功能，同时节约流量,,,(囧...)</div><div><br></div><div>5.重构不会清除现有数据，已经注册的童鞋不必担心</div><div><br></div><div>6.重构后的网站舍弃了对低版本IE的支持，采用HTML5标准来进行前台页面的设计，也许会对低版本IE做最低程度的兼容</div><div><br></div><div>7.重构后的网站会更新用户个人主页的功能</div><div><br></div><div>8.目测重构的工作量不会特别大，目前我已经有了大致的想法，估计半个月左右上线吧</div><div><br></div><div>以上只是现在的计划，不知道我的重构计划会不会成功。</div><div><br></div><div>放张图片，这个就是我重构后网站的效果图</div><div><br></div><div><br></div><div><img src=\"data:image/jpeg;base64,\"><br></div><div><br></div><div><br></div>', 1, '/img/head/default/anime/5.jpg', '偷懒的熊', '2013-8-7 14:06:52', '公告_开发计划', 262, 1, 'top');
INSERT INTO `diary` VALUES (75, '重构主体基本完成，效果太满意了~~', '经过连续三天的通宵作战，以及几天的持续工作，从8月7号开始，到今天为止，wnJava的重构工作取得了‘阶段’性的成果，阶段版本已经发布。<div><br></div><div>这次重构基本实现了计划中的目的，做到了以下的效果：</div><div><br></div><div><ul><li>重新设计了首页布局以及样式，突出了重点。<br></li><li>去掉了图册功能，精简系统功能。<br></li><li>使用了Pjax(Ajax+<span style=\"font-family: Helvetica, arial, freesans, clean, sans-serif; font-size: 15px; line-height: 25px; \">pushState</span>)技术实现了局部刷新跳转。在保证音乐播放器持续播放的同时，用户可以使用浏览器的 后退 按钮！该技术详情会在后续介绍。<br></li></ul></div><div><br></div><div><br></div><div>目前的版本还有许多功能并未完善，注入个人首页以及留言啊用户啊之类的页面，后续我会尽快更新。</div><div><br></div><div><br></div>', 1, '/img/head/default/anime/5.jpg', '偷懒的熊', '2013-8-13 11:33:33', '开发日志_公告', 86, 1, 'normal');
INSERT INTO `diary` VALUES (76, '测试高亮插件', '<div>&lt;br /&gt;</div><div>&lt;h1&gt;&amp;lt;script&gt;方式（‘&amp;lt;’无需进行转义）&lt;/h1&gt;</div><div>&lt;script type=\"syntaxhighlighter\" class=\"brush: csharp;\"&gt;</div><div>&lt;![CDATA[</div><div>public IEnumerator&lt;String&gt; GetEnumerator()// 注意：返回什么，泛型就为什么类型</div><div>{</div><div>&nbsp; &nbsp; for (int i = 0; i&lt;arr_Course.Length; i++)</div><div>&nbsp; &nbsp; {</div><div>&nbsp; &nbsp; &nbsp; &nbsp; Course course = arr_Course[i];</div><div>&nbsp; &nbsp; &nbsp; &nbsp; yield return \"选修：\" + course.Name;</div><div>&nbsp; &nbsp; &nbsp; &nbsp; yield return Environment.NewLine;// 两个 yield return</div><div>&nbsp; &nbsp; }</div><div>}</div><div>]]&gt;</div><div>&lt;/script&gt;</div><div><br></div><div>&lt;h1&gt;&amp;lt;pre&gt;方式（‘&amp;lt;’进行过转义）&lt;/h1&gt;</div><div>&lt;pre class=\"brush: csharp;\"&gt;</div><div>public IEnumerator&lt;String&gt; GetEnumerator()// 注意：返回什么，泛型就为什么类型</div><div>{</div><div>&nbsp; &nbsp; for (int i = 0; i&amp;lt;arr_Course.Length; i++)</div><div>&nbsp; &nbsp; {</div><div>&nbsp; &nbsp; &nbsp; &nbsp; Course course = arr_Course[i];</div><div>&nbsp; &nbsp; &nbsp; &nbsp; yield return \"选修：\" + course.Name;</div><div>&nbsp; &nbsp; &nbsp; &nbsp; yield return Environment.NewLine;// 两个 yield return</div><div>&nbsp; &nbsp; }</div><div>}</div><div>&lt;/pre&gt;</div><div><br></div><div>&nbsp;</div><div><br></div><div>&lt;h1&gt;前面&amp;lt;pre&gt;方式，没有对‘&amp;lt;’进行转义，导致后面的html标签都以字符串的形式解析）&lt;/h1&gt;</div><div>&lt;script type=\"syntaxhighlighter\" class=\"brush: csharp;\"&gt;</div><div>&lt;![CDATA[</div><div>public IEnumerator&lt;String&gt; GetEnumerator()// 注意：返回什么，泛型就为什么类型</div><div>{</div><div>&nbsp; &nbsp; for (int i = 0; i&lt;arr_Course.Length; i++)</div><div>&nbsp; &nbsp; {</div><div>&nbsp; &nbsp; &nbsp; &nbsp; Course course = arr_Course[i];</div><div>&nbsp; &nbsp; &nbsp; &nbsp; yield return \"选修：\" + course.Name;</div><div>&nbsp; &nbsp; &nbsp; &nbsp; yield return Environment.NewLine;// 两个 yield return</div><div>&nbsp; &nbsp; }</div><div>}</div><div>]]&gt;</div><div>&lt;/script&gt;</div>', 1, '/img/head/default/anime/5.jpg', '偷懒的熊', '2013-8-19 10:10:39', '测试_高亮插件', 12, 0, 'delete');
INSERT INTO `diary` VALUES (83, '时间沉淀下的，都是青春啊', '最近翻看了大学时候和基友们一起的照片，感触真的很深.....<div><img src=\"data:image/png;base64,\"><br></div><div><br></div><div>-----潘总的眼睛总是闭着,到底是对什么不忍直视</div><div><br></div><div><br></div>', 1, '/img/head/default/anime/5.jpg', '偷懒的熊', '2013-10-12 19:03:01', '798_青春_634', 5, 0, 'delete');
INSERT INTO `diary` VALUES (84, '杂记', '最近这段时间大概是我今年最高兴的几天吧，无论从哪个方面说。<div><br></div><div><br></div>', 1, '/img/head/default/anime/5.jpg', '偷懒的熊', '2013-10-22 23:33:45', '', 27, 0, 'normal');
INSERT INTO `diary` VALUES (85, '新功能模块开发思路', '两个多月未更新和维护我的网站了，现在跑的好好的，我表示还可以。<div><br></div><div>还有一些很重要的功能没有开发，比如个人主页什么的。但是我已经没兴趣了...</div><div><br></div><div>现在准备开发一个额外的功能，做成类似chatbear那样外挂在主应用上的模块---LoveTime.</div><div><br></div><div>看名字就知道这个是和恋爱有关的，在这几乎无人参观的角落里，本博主庄重宣布，我恋爱了。</div><div><br></div><div>或许这么说还不对，因为我的女神还未同意，先这样记录着吧，下面说说这个新的板块。</div><div><br></div><div>思路来源于一个手机应用：爱情纪念册。</div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div>', 1, '/img/head/default/anime/5.jpg', '偷懒的熊', '2013-10-29 16:35:09', '开发日志', 50, 0, 'normal');
